        {id: 2, name: "Beepo", stack: ["asdasda","asdasd"]},
        {id: 3, name: "Bopo", stack: []},

    ]
    
    return (
        <div>
            {streamers && streamers.map((streamer) => {
                <StreamersListEntry />
            })}
        </div>
    )
}

